हरियाणा की वो ग्राम पंचायत जिसके चार गांवों में लड़के तो कॉलेज जाते रहे पर आज़ाद भारत में लड़कियों की उच्च शिक्षा के रास्ते में कई रोड़े थे. गांव की लड़कियों ने कैसी लड़ी अपनी लड़ाई और पहली बार कॉलेज गईं. 
